const MyComponent = () => {
  return (
    <TooltipProvider>
      <Tooltip placement="right" content="This is a tooltip">
        <div>Hover over me</div>
      </Tooltip>
    </TooltipProvider>
  );
};

export default MyComponent;
```

Now, when you hover over the "Hover over me" text, the tooltip will open, and when you move the mouse away, it will close. If another tooltip is opened, the previously opened tooltip will close.

